import React from 'react';
import './Contact.css';

import styled, { keyframes } from 'styled-components';
import { merge, flash, rubberBand }from 'react-animations';

const tadaFlip = merge(rubberBand, flash);
const bounceAnimation = keyframes`${tadaFlip}`;

const BouncyDiv = styled.div`
  animation: 3s ${bounceAnimation};
`;


export default function Comment() { 
		return (
			<div>
				<div className="anime has-text-centered is-centered">
					<BouncyDiv>Thanks For Stopping By</BouncyDiv>
				</div>
				<div className="socials-wrap">
				<div className="level socials has-background-danger">
				<a href="https://twitter.com/minimalmonkey" class="icon-button twitter"><i class="icon-twitter"></i><span></span></a>
<a href="https://facebook.com" class="icon-button facebook"><i class="icon-facebook"></i><span></span></a>
<a href="https://plus.google.com" class="icon-button google-plus"><i class="icon-google-plus"></i><span></span></a>
				</div>
				</div>
			</div>
		);
	}
